import React from "react";
import '../style.css';

function CargoHeader({description}){
    return (
        <div className="service-contents">
             <div> <i class="fa fa-toggle-on"></i></div>
             <p id="describe">{description}</p>
        </div>
    )
}

export default CargoHeader;
